import React from "react";
import {
	Card,
	CardBody,

} from 'reactstrap';

class Dashboard extends React.Component {
	render() {
		return (
			<Card>
				<CardBody>
					Start your project from here...
				</CardBody>
			</Card>
		);
	}
}

export default Dashboard;
